class Footer extends Component {
render() {
return (
<div className="row" id="footer">
<div className="medium-12 columns">
<p>Copyright 2019 , <a href="https://fahmidasclassroom.com"> fahmidasclassroom</a></p>
</div>
</div>
);
}
}
export default Footer;
